import {Component} from "react";
import './style.css'

class SkipToContent extends Component {

    render() {
        return (
            <div id="SkipToContent">
                <a href={this.props.linkToContent}>Skip to main content!</a>
            </div>
        );
    }
}

export default SkipToContent;
